import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    createStyles,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Theme,
    withStyles,
    WithStyles,
} from '@material-ui/core';
import _ from 'lodash';
//import classes from '*.module.css';

export interface IState {
    apiurl: string;
    datarecords: any[];
    datacolumns: any[];
}
export default class FetchTableData extends React.Component<IState>{

    constructor(props:IState) {
        super(IState);
        this.state = {
            apiurl:'',
            datarecords: [],
            datacolumns: [],
        }
    }

    componentDidMount() {
        axios.get('http://dummy.restapiexample.com/api/v1/employees')
            .then(response => {
                this.setState({ datarecords: response.data });
                //this.extractColumnNames();
                console.log(response.data);
            })
            .catch(error => {
               
            })
    }
    private extractColumnNames() {
        const firstrecord = _.keys(this.state);
        this.setState({ datacolumns: firstrecord, });
    }
    render() {
        return(
        <Paper >
            <p>Employee List</p>

            <Table >
                <TableHead>
                    <TableRow>
                        <TableCell>Id</TableCell>
                        <TableCell>Employee Name</TableCell>
                        <TableCell>Salary</TableCell>
                        <TableCell>Age</TableCell>
                    </TableRow>
                </TableHead>

            </Table>
        </Paper>
            
        );
    }
}
//export default FetchTableData;
